Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData = spark.read.format("csv").option("header", "true").load("onsite_data.csv")
      .select("query", "timestamp")
      .rdd
      .map(row => (row.getString(0), row.getLong(1)))

    // Load top frequent queries
    val topQueries = spark.read.format("csv").option("header", "true").load("top_queries.csv")
      .select("query")
      .rdd
      .map(row => row.getString(0))
      .collect()
      .toSet

    // Broadcast top queries to all nodes
    val broadcastTopQueries = spark.sparkContext.broadcast(topQueries)

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cache = Map[String, Long]()
      val cacheExpiry = 12 * 60 * 60 * 1000 // 12 hours in milliseconds

      iter.map { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          if (cache.get(query).isEmpty || timestamp - cache(query) > cacheExpiry) {
            // Cache miss, send request to retrieve query and cache it
            cache(query) = timestamp
            false
          } else {
            // Cache hit
            true
          }
        } else {
          // Query not in top queries, ignore
          true
        }
      }
    }).reduce(_ && _)

    // Print hit rate
    println(s"Hit rate: ${hitRate}")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from CSV files. It then broadcasts the top queries to all nodes in the cluster.

The job then calculates the hit rate by iterating over the onsite attributed data and checking if each query is in the top queries. If it is, the job checks if the query is in the cache and if it has expired. If the query is not in the cache or has expired, the job sends a request to retrieve the query and caches it for 12 hours. If the query is in the cache and has not expired, the job counts it as a cache hit.

The job finally reduces the hit rate by taking the logical AND of all the hits. If all queries are hits, the hit rate is 1.0. If any query is a miss, the hit rate is 0.0.

Note that this job assumes that the onsite attributed data and top frequent queries are small enough to fit in memory. If they are not, you may need to use a different approach, such as using a distributed cache or a database.

