JavaScript:
```javascript
function sortTable(column) {
  const table = document.getElementById("myTable");
  let rows, switching, i, x, y, shouldSwitch;
  switching = true;

  while (switching) {
    switching = false;
    rows = table.rows;

    for (i = 1; i < (rows.length - 1); i++) {
      shouldSwitch = false;
      x = rows[i].getElementsByTagName("TD")[column];
      y = rows[i + 1].getElementsByTagName("TD")[column];

      if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
        shouldSwitch = true;
        break;
      }
    }

    if (shouldSwitch) {
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
    }
  }
}
```

This code will sort the table rows alphanumerically when you click on the table headers. The `sortTable` function takes the column index as an argument and sorts the table based on that column. The `innerHTML` property is used to get the text content of the table cells.

 Sure, I'd be happy to help! Compiler optimizations are techniques used to improve the performance of the generated code without changing its functionality. Here are a few popular compiler optimization techniques:

1. Constant Propagation: This technique replaces a variable with a constant value if the variable's value is known at compile time.

Example:
```c
int a = 5;
int b = a + 3;
```
After constant propagation:
```c
int b = 8;
```

2. Dead Code Elimination: This technique removes code that does not affect the program's output.

Example:
```c
int a = 5;
int b = a + 3;
int c = 10;
```
After dead code elimination:
```c
int b = 8;
```

3. Loop Unrolling: This technique increases the number of iterations in a loop and reduces the number of loop control instructions.

Example:
```c
for (int i = 0; i < 10; i++) {
    a[i] = b[i] + c[i];
}
```
After loop unrolling:
```c
for (int i = 0; i < 10; i += 2) {
    a[i] = b[i] + c[i];
    a[i+1] = b[i+1] + c[i+1];
}
```

4. Function Inlining: This technique replaces a function call with the body of the function to reduce the overhead of the function call.

Example:
```c
int add(int a, int b) {
    return a + b;
}

int main() {
    int a = 5;
    int b = 3;
    int c = add(a, b);
}
```
After function inlining:
```c
int main() {
    int a = 5;
    int b = 3;
    int c = a + b;
}
```

5. Common Subexpression Elimination: This technique removes redundant computations by identifying common subexpressions and reusing their results.

Example:
```c
int a = b * c;
int d = b * c + e;
```
After common subexpression elimination:
```c
int temp = b * c;
int a = temp;
int d = temp + e;
```

