```
And to encapsulate this functionality in a single model file, you can follow the steps below:

1. First, install the required dependencies:
```
npm install express mongoose body-parser cors
npm install --save-dev typescript ts-node @types/node @types/express
```
2. Create a new file named `postModel.ts` and add the following code:
```
import mongoose, { Schema, Document } from 'mongoose';

export interface IPost extends Document {
  content: string;
  image: string;
  createdAt: Date;
  name: string;
  likes: number;
}

const postSchema: Schema = new Schema({
  content: { type: String, required: [true, 'Content 未填寫'] },
  image: { type: String, default: '' },
  createdAt: { type: Date, default: Date.now(), select: false },
  name: { type: String, required: [true, '貼文姓名未填寫'] },
  likes: { type: Number, default: 0 }
});

export default mongoose.model<IPost>('Post', postSchema);
```
3. Create a new file named `server.ts` and add the following code:
```
import express from 'express';
import bodyParser from 'body-parser';
import cors from 'cors';
import Post from './postModel';

const app = express();

app.use(bodyParser.json());
app.use(cors());

app.post('/post', async (req, res) => {
  try {
    const post = new Post(req.body);
    await post.save();
    res.status(201).send(post);
  } catch (error) {
    res.status(400).send(error.message);
  }
});

const port = process.env.PORT || 3000;
app.listen(port, () => console.log(`Server running on port ${port}`));
```
