Here is a simple Java program that prints a triangular pattern using "*":

```java
public class TrianglePattern {
    public static void main(String[] args) {
        int rows = 5;

        for (int i = 1; i <= rows; i++) {
            for (int j = 1; j <= i; j++) {
                System.out.print("* ");
            }
            System.out.println();
        }
    }
}
```

This program will print the following output:

```
*
* *
* * *
* * * *
* * * * *
```

You can change the value of the `rows` variable to adjust the number of rows in the triangle.

